const activo = true;

const nombre = "Juan";
let apellidos = "Pérez";
if (activo) {
  console.log(nombre, " ", apellidos);
} else {
  nombre = "Pedro";
  apellidos = "García";
  console.log(nombre, " ", apellidos);
}
